import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div className="props">
      <ExpenseItem
        tle={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      />
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
    </div>
  );
}

export default Expenses;
